package bd.edu.seu.model;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import javax.persistence.Entity;import javax.persistence.Id;import javax.persistence.OneToMany;import java.util.List;@Data@AllArgsConstructor@NoArgsConstructor@Entitypublic class Product {    @Id    private long id;    private String name;    private String quantityPerUnit;    private double UnitPrice;    private double unitsInStock;    private double unitsOnOrder;    private double reOrderLevel;    private double discontinued;    @OneToMany    private List<Supplier> suppliers;}